import { CREATE_FILTER } from '../actions/index';

const defaultFilter = 'All';
const filterReducer = (state = defaultFilter, action) => {
  console.log(action.payload);
  switch (action.type) {
    case CREATE_FILTER:
      return action.payload;

    default:
      return state;
  }
};

export default filterReducer;
